import React, { useState } from 'react';
import { TodoWrapper } from './components/TodoWrapper';
import './App.css';  // Import the App.css file for styling

const App = () => {
  const [showTodoWrapper, setShowTodoWrapper] = useState(false);
  const [carName, setCarName] = useState('');

  const handleSubmit = (e) => {
    e.preventDefault();
    if (carName.trim()) {
      setShowTodoWrapper(true);  // Show TodoWrapper after submission
    }
  };

  return (
    <div className="App">
      {!showTodoWrapper ? (
        <div className="inspection-container">
          <div className="car-status">
            <p>Existing car with status: Inspecting</p>
          </div>
          <h1>REPORT CAR INSPECTION RESULTS</h1>
          <form className="inspection-form" onSubmit={handleSubmit}>
            <label htmlFor="carName">Car Name</label>
            <input
              type="text"
              id="carName"
              value={carName}
              onChange={(e) => setCarName(e.target.value)}
              placeholder="Enter car name"
              className="todo-input"
            />
            <button type="submit" className="todo-btn">Report Inspection</button>
          </form>
        </div>
      ) : (
        <TodoWrapper />
      )}
    </div>
  );
};

export default App;
